DROP TABLE IF EXISTS `def_inidata`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `def_inidata` (
  `dkpiId` varchar(45) default NULL COMMENT '环境测评指标定义ID',
  `diniDataCalRuleId` varchar(45) default NULL COMMENT '计算规则ID',
  `diniDataId` varchar(45) NOT NULL default '0' COMMENT '环境测评源数据项定义ID',
  `diniDataAuthRuleId` varchar(45) default NULL COMMENT '权限规则ID',
  `diniDataName` varchar(100) default NULL COMMENT '源数据项名称',
  `submitOrgRole` varchar(45) default NULL COMMENT '申报机构角色标识',
  `diniDataExpireMark` tinyint(2) default '0' COMMENT '源数据项过期标志位',
  `isStaticMark` tinyint(2) default '0' COMMENT '源数据项是否为统计项',
  `diniDataDelMark` tinyint(2) default '0' COMMENT '源数据项删除标志位',
  `diniDataType` varchar(10) default NULL COMMENT '原数据类型',
  `diniDataRemark` varchar(250) default NULL COMMENT '环境测评源数据项定义说明',
  `create_time` datetime default NULL COMMENT '环境测评类别定义时间',
  `update_time` datetime default NULL COMMENT '环境测评类别定义修改时间',
  `update_by` varchar(45) default NULL,
  `create_by` varchar(45) default '',
  `diniDataLabel` varchar(45) NOT NULL COMMENT '显示名称',
  `diniDataRequired` tinyint(2) default NULL COMMENT '是否必须',
  `diniDataMaxLength` int(5) default NULL,
  `diniDataMinLength` int(5) default NULL,
  `diniDataUnit` varchar(45) default '1' COMMENT '输入单位',
  `diniDataMinValue` double(10,3) default NULL,
  `diniDataMaxValue` double(10,3) default NULL,
  `diniFractionDigits` int(11) default '2' COMMENT '小数点位数',
  PRIMARY KEY  (`diniDataId`),
  KEY `fk_def_inidata_def_kpi_1` (`dkpiId`),
  KEY `fk_def_inidata_def_formula_1` (`diniDataCalRuleId`),
  KEY `fk_def_inidata_def_authrule_1` (`diniDataAuthRuleId`),
  CONSTRAINT `def_inidata_ibfk_1` FOREIGN KEY (`diniDataAuthRuleId`) REFERENCES `def_authrule` (`authRuleId`),
  CONSTRAINT `def_inidata_ibfk_2` FOREIGN KEY (`diniDataCalRuleId`) REFERENCES `def_formula` (`calRuleId`),
  CONSTRAINT `def_inidata_ibfk_3` FOREIGN KEY (`dkpiId`) REFERENCES `def_kpi` (`dkpiId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='指标计算源数据项定义表';
/*!40101 SET character_set_client = @saved_cs_client */;

