  `dkpiWeight` float(20,0) default NULL COMMENT '环境测评指标权重',
  `dkpiscore` float(10,3) default NULL COMMENT '环境测评指标分值',
  `dkpiDelMark` tinyint(2) default '0' COMMENT '环境测评指标指标删除标志位',
