  `update_time` datetime default NULL COMMENT '环境测评类别定义修改时间',
  `update_by` varchar(45) default NULL,
  `create_by` varchar(45) default '',
  `dkpiSquence` int(11) default '0',
  `complex` tinyint(4) default '0',
  `pid` varchar(45) default NULL,
  `dkpiStandardizeType` tinyint(4) default NULL COMMENT '计算类型(正向，逆向，有无）',
  `dkpiExtendExp` varchar(200) default NULL COMMENT '扩展计算',
  PRIMARY KEY  (`dkpiId`),
  KEY `fk_def_kpi_def_formula_1` (`dkpiCalRuleId`),
  KEY `fk_def_kpi_def_authrule_1` (`dkpiAuthRuleId`),
  CONSTRAINT `def_kpi_ibfk_1` FOREIGN KEY (`dkpiAuthRuleId`) REFERENCES `def_authrule` (`authRuleId`),
  CONSTRAINT `def_kpi_ibfk_2` FOREIGN KEY (`dkpiCalRuleId`) REFERENCES `def_formula` (`calRuleId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='指标定定义表';
