INSERT INTO `def_questions` VALUES (1,'1','企业遇到经济纠纷时，最有效果的解决方式是',NULL,'诉诸司法部门','求助政府部门，通过行政手段解决','通过行业协会等商人自治组织解决','通过其他社会关系解决','很难找到有效途径解决','','','1',NULL,NULL,NULL,'0'),(2,'1','当企业诉诸法院解决经济纠纷时，您认为司法判决的公正性',NULL,'公正，对判决结果很满意','公正','不公正，法官的知识水平有限','不公正，法官判决没有做到尽职调查','很不公正，法官判决受到外力因素影响','','','1',NULL,NULL,NULL,'0'),(3,'1','当企业诉诸法院解决经济纠纷时，从提交申请到开庭平均需要时间',NULL,'一周以内','一周至半个月','半个月至一个月','一个月至三个月','三个月以上','','','1',NULL,NULL,NULL,'0'),(4,'1','当企业在经济纠纷中胜诉后，法院的执行力如何',NULL,'方法灵活得当，执行快速有力','按部就班的执行','尽管胜诉，法院没有很好的方法执行','执行人员缺乏足够激励执行','执行人员获得好处才执行','','','1',NULL,NULL,NULL,'0'),(5,'2','企业对当地商业信用文化的整体评价',NULL,'信用很好，当企业运转出现困难时会及时通知相关企业，一旦正常立刻归还贷款','信用较好，贷款往来正常','信用教差，存在大量故意拖欠贷款现象','信用很差，存在即使有钱也故意拖欠贷款的现象','','','','1',NULL,NULL,NULL,'0'),(6,'2','地方政府在诚信文化建设方面的支持程度，您的评价是',NULL,'很积极，做了很多实事，如推出企业黑名单、治理网络谣言等诸多措施并积极落实','较积极，制定了一些诚信建设方面的措施','不积极，不是政府工作的重点','很不积极，根本不在政府工作规划之中','',NULL,NULL,'1',NULL,NULL,NULL,'0'),(7,'3','您是否考虑过主动向征信机构提供自己的信息，以便在申请贷款时更容易获得批准',NULL,'考虑过并已经向征信机构提供','考虑过，但出于对信息的安全有所顾虑而未向征信机构提供自己的信息','没考虑过',NULL,NULL,NULL,NULL,'1',NULL,NULL,NULL,'0'),(8,'3','在商业往来中，企业考虑过通过征信机构来查询相关的信息吗？',NULL,'考虑并实施，征信机构提供的信息有价值，可使企业免受损失','考虑并实施，但征信机构提供的信息没有什么价值','没有考虑过','','','','','1',NULL,NULL,NULL,'0'),(9,'1','您对当地政府经济政策的一致性和连贯性的评价',NULL,'政策方向很明确，前后一致','比较一致，比较连贯','一般','比较难以把握政策动向','政策前后不一致，经常变化',NULL,NULL,'1',NULL,NULL,NULL,'0'),(10,'1','您对当地政府的政策以及执行过程透明度的评价',NULL,'很透明','比较透明','一般','比较差','很差',NULL,NULL,'1',NULL,NULL,NULL,'0'),(11,'1','您对政府公务员在相关经济政策咨询方面的办事效率和态度评价',NULL,'很好','较好','一般','较差','差','','','1',NULL,NULL,NULL,'0'),(12,'1','近但年来，本银行（或信用社）提起法律诉讼的债券案件一般回收率估计能达到',NULL,'80%以上','60% ~ 80%','40% ~ 60%','20% ~ 40%','20%以下','','','2',NULL,NULL,NULL,'0'),(13,'3','银行在从事信贷业务中，遭到当地政府干预的情况',NULL,'没有受到干预','干预程度较小','干预程度较大','','','','','2',NULL,NULL,NULL,'0'),(14,'1','导致银行不能有效回收债券，是由于债券企业有背景，受到地方政府的暗中庇护，出现这种情况的可能性：',NULL,'很小','较小','一般','较大','非常大','','','2',NULL,NULL,NULL,'0'),(15,'1','企业主观上故意逃避债务，比如事前已经对资产进行转移、甩空银行债务等；这种情况出现的可能性：',NULL,'很小','较小','一般','较大','非常大','',NULL,'2',NULL,NULL,NULL,'0'),(16,'1','企业已经严重亏损，已经资不抵债，执行后仍无法偿还全部债务，这种情况出现的可能性',NULL,'很小','较小','一般','较大','非常大',NULL,NULL,'2',NULL,NULL,NULL,'0'),(17,'1','个人制造假证件、伪造信息，办理额度较高的信用卡并套现取现金，这种情况出现的可能性',NULL,'很小','较小','一般','较大','很大',NULL,NULL,'2',NULL,NULL,NULL,'0'),(18,'1','您认为本地地方政府融资平台整体的资产负债水平（资产负债率）大致为：',NULL,'40%以下','40% ~ 50%','50% ~ 60%','60% ~ 70%','70%以上','',NULL,'2',NULL,NULL,NULL,'0'),(19,'2','您认为本地地方政府融资平台的偿债能力如何',NULL,'很强','较强','一般','很弱',NULL,NULL,NULL,'2',NULL,NULL,NULL,'0');
/*!40000 ALTER TABLE `def_questions` ENABLE KEYS */;
UNLOCK TABLES;

