  CONSTRAINT `value_inidata_ibfk_3` FOREIGN KEY (`viniDataCalRuleId`) REFERENCES `def_formula` (`calRuleId`),
  CONSTRAINT `value_inidata_ibfk_4` FOREIGN KEY (`diniDataId`) REFERENCES `def_inidata` (`diniDataId`),
  CONSTRAINT `value_inidata_ibfk_6` FOREIGN KEY (`viniDataRegion`) REFERENCES `dict_city_area` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='源数据项定义表';
